import React from 'react'

const rulesHooks = () => {

    const biodata = [
        {
            id:0, myname:"vind", age:26
        },
        {
            id:1, myname:"Shubham", age:23
        },
        {
            id:2, myname:"chaudhari", age:25
        },
    ]

    return (
        <div>
            <h1>Name: Vinod & age: 26</h1>
            {
                biodata.map( (value)=>{
                    <h1>My name is ${value.myname}</h1>
                } )
            }
        </div>
    )
}

export default rulesHooks
